          "id": "f6594a3cbd100f7dffbd0b934cf1ded4eff40bd6",
          "message": "Condition Testmo run creation on event type (#86)\n\nSUMMARY:\r\nThis change updates the `nm-build.yml` job to not create a Testmo run if\r\nit was triggered manually (`workflow_dispatch`). The logic specifically\r\nuses that direction because workflows triggered by `workflow_call`\r\nappear to assume the originating `github.event_type` (so it could be\r\n`push`, `schedule`, etc.), thus, trying to go the other direction would\r\nhave to check multiple event types.\r\n\r\nTEST PLAN:\r\nThe remote-push checks for this PR/branch show that the Testmo run was\r\ncreated as expected in the `BUILD` job. Separately, I triggered the\r\n[`nm-build.yml` workflow\r\nmanually](https://github.com/neuralmagic/nm-vllm-ent/actions/runs/11145772844)\r\nto verify that no Testmo run is created in that scenario.",
