          "id": "77db673c67ce6410e68939fd1ff8db6065988524",
          "message": "enable more debugging in automation (#84)\n\nSUMMARY:\r\n* \"build\", \"test\", \"benchmark\", and \"lm-eval\" workflows have been\r\nupdated to make them callable. this will allow us to run through a\r\nsingle stage in automation provided we have assets from a build job. in\r\nparticular, making \"test\" workflow callable enables not having to sit\r\nthrough a build. this along with the skip mechanism shortens the\r\ndeveloper loop while we work through patches in `tests` directory.\r\n* adding helper script to invoke: build, test, benchmark, and lm-evel.\r\nthe scripts should be sufficient for running larger experiments via\r\nscripting.\r\n* install python via \"set python\" in \"debug workflow\" and add option to\r\nspecify python installed via \"set python\"\r\n\r\nTEST PLAN:\r\ndogfooding and runs on remote push\r\n\r\nnm-build.yml ...\r\nhttps://github.com/neuralmagic/nm-vllm-ent/actions/runs/11182839300\r\n\r\nthe following use the `run_id` from the above build\r\n\r\nnm-benchmark.yml ...\r\nhttps://github.com/neuralmagic/nm-vllm-ent/actions/runs/11183464277\r\n\r\nnm-lm-eval.yml ...\r\nhttps://github.com/neuralmagic/nm-vllm-ent/actions/runs/11184027633\r\n\r\nnm-test.yml ...\r\nhttps://github.com/neuralmagic/nm-vllm-ent/actions/runs/11193109513\r\n\r\nhere is the usage from each script\r\n\r\n```\r\n> ./.github/scripts/invoke-build -h\r\nUsage: ./.github/scripts/invoke-build <options>\r\n\r\nall <options> have standard defaults\r\n\r\n  -h    - this list of options\r\n  -w    - wf_category\r\n  -l    - runner label to use\r\n  -t    - timeout in minutes\r\n  -r    - gitref\r\n  -m    - GI to reserve per thread\r\n  -n    - number of 'nvcc' threads\r\n  -p    - python version to run while building\r\n  -b    - branch to use in '--ref <branch>'\r\n\r\n```\r\n\r\n```\r\n> ./.github/scripts/invoke-test -h\r\nUsage: ./.github/scripts/invoke-test <options>\r\n\r\nunless noted <options> have standard defaults. triggering\r\nnm-test with this script will not push results to Testmo\r\n\r\n  -h    - this list of options\r\n  -l    - runner label to use\r\n  -t    - timeout in minutes\r\n  -r    - gitref\r\n  -p    - python version to run while building\r\n  -i    - GHA run_id (required)\r\n  -c    - test skip env vars config file\r\n  -v    - enable code coverage report (true or false)\r\n  -b    - branch to use in '--ref <branch>'\r\n\r\n```\r\n\r\n```\r\n> ./.github/scripts/invoke-benchmark -h\r\nUsage: ./.github/scripts/invoke-benchmark <options>\r\n\r\nunless noted <options> have standard defaults. triggering\r\nbenchmarks with this script will not push results to 'gh_pages'\r\n\r\n  -h    - this list of options\r\n  -l    - runner label to use\r\n  -c    - benchmark config list file\r\n  -t    - timeout in minutes\r\n  -r    - gitref\r\n  -p    - python version to run while building\r\n  -i    - GHA run_id (required)\r\n  -b    - branch to use in '--ref <branch>'\r\n\r\n```\r\n\r\n```\r\n> ./.github/scripts/invoke-lm-eval -h\r\nUsage: ./.github/scripts/invoke-lm-eval <options>\r\n\r\nunless noted <options> have standard defaults.\r\n\r\n  -h    - this list of options\r\n  -l    - runner label to use\r\n  -c    - lm-eval config file\r\n  -t    - timeout in minutes\r\n  -r    - gitref\r\n  -p    - python version to run while building\r\n  -i    - GHA run_id (required)\r\n  -b    - branch to use in '--ref <branch>'\r\n\r\n```\r\n\r\n---------\r\n\r\nCo-authored-by: andy-neuma <andy@neuralmagic.com>",
